import Form from './form';
import React  from 'react';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import About  from './About';
import Home from './Home';
function App() {
  return (
    <>
    <BrowserRouter>
    <a href="/">Home</a>
    <a href="/about">About</a>
    <Switch>
    <Route  path="/about" >
    <About /> 
    <Form />
    </Route>
    <Route exact path="/" render={()=><Home />}/>
    <Route path="*">
      404 Page
    </Route>
    </Switch>
    </BrowserRouter>

    </>
  );
}

export default App;
